import { Component, OnInit } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { StockService } from 'src/app/services/stock.service';
@Component({
  selector: 'app-sentiment-detail',
  templateUrl: './sentiment-detail.component.html',
  styleUrls: ['./sentiment-detail.component.css']
})
export class SentimentDetailComponent implements OnInit{
  constructor(private StockService : StockService, private activatedRoute: ActivatedRoute){
    this.activatedRoute.snapshot.params['symbol'];
  }

  ngOnInit(): void {
    console.log(this.activatedRoute.snapshot.params['symbol'], 'symbol=====');
    this
  }

  getStockInsiderSentiment(comapnyName:string){
    this.StockService.getStockQuotedData(this.name).subscribe((data:any) => {
      let obj = {
        companyName : comapnyName,
        changeToday : data.d,
        openingPrice : data.o,
        curentPrice : data.c,
        highPrice  : data.h,
        name: this.name
      }
      this.stockList.push(obj)
      this.StockService.setToLocalStorage('stockList', JSON.stringify(this.stockList));;
      this.name='';
    })
  }
}
